import './styles.css';
import Container from 'react-bootstrap/Container';
const Footer = () => {

    return (
        <div className='footer'>
            <Container>
                <div>
                    <h1 style={{
                        marginTop: '10px',
                        padding: '10px',
                        fontFamily: 'Ledger, serif',
                        fontSize: '28px',
                        backgroundColor: '',
                    }}>Clinic</h1>
                </div>
                <h1 style={{
                        marginTop: '10px',
                        padding: '10px',
                        fontFamily: 'Ledger, serif',
                        fontSize: '28px',
                        backgroundColor: '',
                    }}>Social Media</h1>
            </Container>
        </div>
    )

  };

export default Footer;
